    Operating Acct to adjust the LRD reimbursement ratio as of April 2, 2013 (the
    60 day post-event deadline) to 9.2% for those LRD expenses originally reimbursed
    at 20% from the State account. The ratio was adjusted from the estimated ratio
    of 20% to reflect the ratio of 'funds received' which was 9.2% state as of April
